import React from "react"

import StudentsData from "./StudentsData"

export default function DataTable(){

  const Students = (
    StudentsData.map(studenInfo => {
      return (
        <tr>
          <td>{studenInfo.Code}</td>
          <td>{studenInfo.StudentName}</td>
          <td>{studenInfo.StudentId}</td>
          <td>{studenInfo.Att}</td>
          <td></td>
        </tr>
      )
    })
  )

  return (
    <table>
      <thead>
        <tr>
          <th>Code</th>
          <th>Student Name</th>
          <th>Student Id</th>
          <th>Attendance</th>
          <th>Participation</th>
        </tr>
      </thead>

      <tbody>

      </tbody>
    </table>
  )

}
